import axios from 'axios';
import { ADD_DIARY } from './types';

//add Diary
export const addDiary = diary => dispatch => {
        axios
        .post("/api/diary/diaries/new", diary)
        .then(res => {
            console.log(res.data)
            dispatch({
                type: ADD_DIARY,
                payload: res.data
            })

        })
        .catch(error => {
            console.log(error.response.data)
        })
    }
